import collections
import math
class Solution:
    def countPairs(self, deliciousness: List[int]) -> int:
        mydict = collections.defaultdict(int)
        res, MAX = 0, 10**9+7
        deliciousness.sort()
        for d in deliciousness:
            if d == 0:
                mydict[d] += 1
                continue
            if d > 1 and int(math.log2(d))/math.log2(d) == 1.0:
                if 0 in mydict: # cover the case: d=2, [0,2] or d=4, [0,4]
                    res += mydict[0]
                x = int(math.log2(d))+1
                y = (2**x - d)
                if y in mydict:
                    res += mydict[y]
            elif d == 1:
                if 0 in mydict:
                    res += mydict[0]
                if 1 in mydict:
                    res += mydict[1]
            else:
                x = int(math.log2(d))+1
                y = (2**x - d)
                if y in mydict:
                    res += mydict[y]
            mydict[d] += 1
        return res%MAX



